Date.prototype.fromISO8601 = function (isoDateString) {
    var parts = isoDateString.match(/\d+/g);
    var isoTime = Date.UTC(parts[0], parts[1] - 1, parts[2], parts[3], parts[4], parts[5]);
    var isoDate = new Date(isoTime);

    return isoDate;
};

